import { useLoaderData , JsonFunction  } from 'react-router-dom';
import EventsList from '../components/EventsList';

// You can useLoaderData() hook in the element that's assigned to a route AND 
// in all components that might be used inside that element. 

function EventsPage() {
  const data = useLoaderData();
  const events = data.events;

  return <EventsList events={events}/>;
}

export default EventsPage;


export async function loader() {
    const response = await fetch('http://localhost:8080/events');

    if (!response.ok) {
      // ...
      // throw new Response(JSON.stringify({ message : 'Could not fetch events.'}), {
      //   status : 500
      // });
      return JsonFunction({message : 'Could not fetch events.'} , {status : 500});
    } else {
      return response;
  } 
}
